import React, { useState } from 'react';
import { Container } from '../shared/global';
import axios from 'axios';
import careerData from './../careerData';

const ChooseCareer = () => {
	const [chosenSalary, setChosenSalary] = useState();
	console.log(chosenSalary);
	return (
		<Container>
			<select onChange={(e) => setChosenSalary(e.target.value)}>
				<option disabled>Select One</option>
				{careerData.map((data, index) => (
					<option key={index}>{data.careerName}</option>
				))}
			</select>
			{careerData
				.filter(({ careerName }) => careerName === chosenSalary)
				.map((data, index) => (
					<div key={index}>
						<p>{data.careerName}</p>
						<p>{data.salary}</p>
					</div>
				))}
		</Container>
	);
};

export default ChooseCareer;
